import React, { useState } from 'react';
import './css/App.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';

import Button from 'react-bootstrap/Button';
import CustomServices from './components/CustomServices';

function App() {
  const [firsName, setFirst] = useState("");
  const [lastName, setLast] = useState("");
  const [email, setEmail] = useState("");
  const [message, setMessage] = useState("");


  function handleFirstName(e){
    setFirst(e.target.value);
    return setFirst;
  }

  function handleLastName(e){
    setLast(e.target.value);
    return setLast;
  }

  function handleEmail(e){
    setEmail(e.target.value);
    return setEmail;
  }

  function handleMessage(e){
    setMessage(e.target.value);
    return setMessage;
  }

  function handleFormSubmit( event ) {
    event.preventDefault();
    console.log(event);
  }

  return (
    <div className="App">
      <Navbar sticky="top" expand="lg" className='airpng-navbar'>
        <Container>
          <Navbar.Brand href="#home">Airpng</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav" className='right-aligned'>
            <Nav className="ml-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#services-sec">Our Services</Nav.Link>
              {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown> */}
              <Nav.Link href="#contact">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <section class="section parallax bg1" id="home">
        <Container className="airpng-top">
          <h1>Airpng</h1>
          <h1>High quality photos that grow your bookings</h1>
        </Container>
      </section>
      <section class="section static" id="services-sec">
        <div className="our-services-sec">
          <h1>Our Services</h1>
          <Container className='our-services-card-container' fluid>
            <CustomServices/>
          </Container>
          </div>
      </section>
      <section class="section parallax bg2" id="contact">
        <div className="contact-us-container">
        <h1>Contact us</h1>
         <Form>
            <Form.Group className="mb-3" controlId="formFirstName">
              <Form.Label>First Name</Form.Label>
              <Form.Control type="text" value={firsName} placeholder="Enter First Name" onChange={handleFirstName}/>
            </Form.Group>
            <Form.Group className="mb-3" controlId="formLastName">
              <Form.Label>Last Name</Form.Label>
              <Form.Control type="text" placeholder="Enter Last Name" onChange={handleLastName} />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="Enter email" onChange={handleEmail} />
              <Form.Text className="text-muted" id="mute">
                We'll never share your email with anyone else.
              </Form.Text>
            </Form.Group>

            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
              <Form.Label>Your Message</Form.Label>
              <Form.Control as="textarea" rows={3} onChange={handleMessage} />
            </Form.Group>
            <Button variant="primary" type="submit" onClick={e => handleFormSubmit(e)} value="Submit">
              Submit
            </Button>
          </Form>
        </div>
      </section>
    </div>
  );
}

export default App;
